  display: grid;
  grid-template-columns: 20px auto;
`;
const PicSection = styled.div`
  grid-column-start: 1;
  grid-column-end: 2;
`;
const TextSection = styled.div`
  grid-column-start: 2;
  grid-column-end: 3;
`;
export default function Category({
  picAdress,
  text,
}: {
  picAdress: string;
  text: string;
}) {
  // styles

  return (
    <CategoryItem>
      <PicSection>D</PicSection>
      <TextSection>Text</TextSection>
    </CategoryItem>
  );
}
